commits.content:
.caintainer{
    display: flex;
    flex-direction: column;
    justify-content: center;
    margin-top: 40px;
    width: 100%;
    background-image: linear-gradient(to right, #6a11cb 0%, #2575fc 100%);
    margin: 0 auto;
    margin-top: 20px;
    width: 90%;
    align-items: center;
    box-shadow: rgba(0, 0, 0, 0.56) 0px 22px 70px 4px;
    border: 6px solid black;
    font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
    border-radius: 15px;
    padding: 10px 0px ;
    .heading{
        display: flex;
        flex-direction: column;
        width: 100%;
        text-align: center;
    }
    .boxes{
        display: flex;
        gap: 40px;
        justify-content: center;
        padding: 60px;
        .box{
            height: 300px;
            width: 250px;
            background-color: white;
            border: 4px solid black;
            display: flex;
            flex-direction: column;
            justify-content: space-evenly;
            align-items: center;
            text-align: justify;
            padding: 10px;
        }
    }
    
}
@media screen and (max-width:"768px") {
    .caintainer{
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        justify-content: center;
        .heading{
            font-size: 10px;
        }
        .boxes{
            display: flex;
            flex-direction: column;

        }
        
    }
}
